import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { FaUserCircle } from "react-icons/fa";

export default function NavbarComponent() {
  return (
    <Container>
      <Row>
        <Col xs={6} md={4}>
          Cinema App
        </Col>
        <Col xs={6} md={4}>
          <input type="text" placeholder="search" />
        </Col>
        <Col xs={6} md={4}>
          <div>
            <FaUserCircle />
          </div>
        </Col>
      </Row>
    </Container>
  );
}
